import React, { useState } from "react";
import axios from "axios";

function FeatureForm() {
  const [form, setForm] = useState({
    follicle_r: "",
    follicle_l: "",
    cycle_length: "",
    amh: "",
    bmi: ""
  });

  const [result, setResult] = useState(null);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post("http://localhost:5000/predict", form);
      setResult(res.data.prediction ? "PCOS Detected" : "No PCOS");
    } catch (err) {
      alert("Error predicting");
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Follicle No. (R):</label>
        <input name="follicle_r" value={form.follicle_r} onChange={handleChange} required />
      </div>
      <div>
        <label>Follicle No. (L):</label>
        <input name="follicle_l" value={form.follicle_l} onChange={handleChange} required />
      </div>
      <div>
        <label>Cycle length (days):</label>
        <input name="cycle_length" value={form.cycle_length} onChange={handleChange} required />
      </div>
      <div>
        <label>AMH (ng/mL):</label>
        <input name="amh" value={form.amh} onChange={handleChange} required />
      </div>
      <div>
        <label>BMI:</label>
        <input name="bmi" value={form.bmi} onChange={handleChange} required />
      </div>
      <button type="submit">Predict</button>
      {result && <h3>Prediction: {result}</h3>}
    </form>
  );
}

export default FeatureForm;
